-- ----------------------------
-- Table structure for `characteristic`
-- ----------------------------
DROP TABLE IF EXISTS `characteristic`;
CREATE TABLE `characteristic` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `price` varchar(255) NOT NULL COMMENT '房价',
  `area` varchar(255) DEFAULT NULL COMMENT '房屋面积',
  `age` varchar(255) DEFAULT NULL COMMENT '房龄:2015年房屋房龄为0,2014年为1...',
  `orientation` varchar(255) DEFAULT NULL COMMENT '朝向:西北=1，西=2，北=3，东北=4，东=5，西南=6，南=7，东南=8',
  `floor` varchar(255) DEFAULT NULL COMMENT '楼层',
  `decoration` varchar(255) DEFAULT NULL COMMENT '装修：毛坯=1，简单装修=2，中等装修=3，精装修=4，豪华装修=5',
  `house_allocation` varchar(255) DEFAULT NULL COMMENT '房屋配置：床、衣柜、沙发、电视、冰箱、洗衣机、空调、热水器、宽带、暖气每项计1分',
  `hall` varchar(255) DEFAULT NULL COMMENT '几厅',
  `room` varchar(255) DEFAULT NULL COMMENT '几室',
  `zone` varchar(255) DEFAULT NULL COMMENT '城区:见数据库city_zone中id',
  `district` varchar(255) DEFAULT NULL COMMENT '片区：见数据库city_district中id',
  `community` varchar(255) DEFAULT NULL COMMENT '小区：见数据库city_community中id',
  `bus` varchar(255) DEFAULT NULL COMMENT '公交数',
  `subway` varchar(255) DEFAULT NULL COMMENT '地铁数',
  `education` varchar(255) DEFAULT NULL COMMENT '教育配套：(1000m内)幼儿园、小学、初中、高中、大学各计1分',
  `support` varchar(255) DEFAULT NULL COMMENT '生活配套:(1000m内)银行、超市、医院、公园各计1分',
  `management_fee` varchar(255) DEFAULT NULL COMMENT '物业管理费',
  `green_rate` varchar(255) DEFAULT NULL COMMENT '绿化率',
  `plot_rate` varchar(255) DEFAULT NULL COMMENT '容积率',
  `station` varchar(255) DEFAULT NULL COMMENT '是否临近车站：房屋临近车站(1000m)为1，否则为0',
  `url` varchar(255) DEFAULT NULL COMMENT '房源地址(避免相同房源)',
  PRIMARY KEY (`id`),
  KEY `url_idx` (`url`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=9628 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of characteristic
-- ----------------------------

